import React from 'react';
import Post from './PostSection/Post';
import Suggestion from './Suggestion';
import Profile from './ProfileSection/Profile';
import Footer from './footerSection/Footer';

function Main() {
    return (
        <div>
            <div
                className="main"
                style={{ display: 'flex'}}
            >
                <Profile style={{width:"20%"}}/>
               <div style={{width:'50%'}}>
               <Post />
               <Footer/>
               </div>
               <div style={{width:'50%'}}>
                <Suggestion />
               </div>
            </div>
        </div>
    );
}

export default Main;
